import React from 'react';
import Select from 'react-select';
import { letters } from './menus/options'; // Import the 'letters' variable from options.js

const LetterDropdown = ({ onSelectLetter }) => {
    return (
        <div className="dropdown-container">
            <label className="dropdown-label">Select Letter</label>
            <Select options={letters} onChange={(e) => onSelectLetter(e.value)} /> {/* Use 'letters' directly */}
        </div>
    );
};

export default LetterDropdown;
